import { Button, Header, Icon, Image, Menu, Segment, Sidebar } from 'semantic-ui-react'
import { connect } from 'react-redux';
import * as actions from '../redux/actions';

const sprites = [{
  name: 'guitar', url:'https://www.svgimages.com/svg-image/s5/guitar-icon-256x256.png'
}]

class SpriteBar extends Component{


  render(){
    const divStyle = {position: 'absolute',
      width: '150px',
      height: '100vh',
      left: '0',
      top: '10',
      backgroundColor: '#EEEEEE',
      borderRight: '1px dotted'}

    return(
      <div style={divStyle} className="wip" onDragOver={(e)=>this.onDragOver(e)}
        onDrop={(e)=>{this.onDrop(e, "wip")}}>
        <span className="task-header">WIP</span>
          {tasks.wip}
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    // animalSrc: state.animal.animalSrc,
    // isLoading: state.animal.isLoading,
  }
}

export default connect(mapStateToProps, actions)(SpritesBar);
